import React, {Component} from 'react';

class Header extends Component {
  render() {
    return (
      <div className='Header'>
      <div className='Text'>
      <h1>HighOnCoding</h1>
      <a href='http://highoncoding.com/Home/'> <h2>Home</h2> </a>
      <h2 id="Categories">Categories</h2>
      </div>
      </div>
    )
  }
}

export default Header
